import React from "react";

export default function IndiretaFIlho(props) {
  return (
    <div>
      <div>Filho</div>
      <button onClick={(e) => props.quandoClicar("Eneas", 102, true)}>
        Fornecer Informacoes
      </button>
    </div>
  );
}
